-- View structure for fa_view_instance
-- ----------------------------
DROP VIEW IF EXISTS `fa_view_instance`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `fa_view_instance` AS select `a`.`id` AS `id`,`a`.`originator` AS `originator`,`a`.`scheme` AS `scheme`,`a`.`createtime` AS `createtime`,`a`.`instancestatus` AS `instancestatus`,`a`.`bizobjectid` AS `bizobjectid`,`a`.`instancecode` AS `instancecode`,`a`.`completedtime` AS `completedtime`,`b`.`nickname` AS `nickname`,`c`.`flowname` AS `flowname` from ((`fa_flow_instance` `a` left join `fa_admin` `b` on((`a`.`originator` = `b`.`id`))) left join `fa_flow_scheme` `c` on((`a`.`scheme` = `c`.`id`)));

-- ----------------------------
-- View structure for fa_view_workitem
-- ----------------------------
DROP VIEW IF EXISTS `fa_view_workitem`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `fa_view_workitem` AS select `b`.`instancestatus` AS `instancestatus`,`b`.`instancecode` AS `instancecode`,`b`.`bizobjectid` AS `bizobjectid`,`c`.`bizscheme` AS `bizscheme`,`e`.`nickname` AS `receivename`,`c`.`flowname` AS `flowname`,`c`.`flowcode` AS `flowcode`,`b`.`originator` AS `originator`,`d`.`nickname` AS `nickname`,`a`.`id` AS `id`,`a`.`previd` AS `previd`,`a`.`prevstepid` AS `prevstepid`,`a`.`receiveid` AS `receiveid`,`a`.`stepid` AS `stepid`,`a`.`flowid` AS `flowid`,`a`.`stepname` AS `stepname`,`a`.`instanceid` AS `instanceid`,`a`.`groupid` AS `groupid`,`a`.`type` AS `type`,`a`.`tittle` AS `tittle`,`a`.`senderid` AS `senderid`,`a`.`opentime` AS `opentime`,`a`.`completedtime` AS `completedtime`,`a`.`comment` AS `comment`,`a`.`isSign` AS `isSign`,`a`.`status` AS `status`,`a`.`note` AS `note`,`a`.`sort` AS `sort`,`a`.`createtime` AS `createtime` from ((((`fa_flow_instance` `b` left join `fa_flow_task` `a` on((`a`.`instanceid` = `b`.`id`))) left join `fa_flow_scheme` `c` on((`b`.`scheme` = `c`.`id`))) left join `fa_admin` `d` on((`b`.`originator` = `d`.`id`))) left join `fa_admin` `e` on((`a`.`receiveid` = `e`.`id`)));
